import React from 'react'

const CheckBox = (props) => {

  const {onChange,
          data:{ id, descripcion, done}}= props

  return (
    <div className='border rounded border-indigo-600'>
      <label className='flex flex-row justify-center'>
        <input
        type="checkbox"
        defaultChecked={done}
        name={id}
        onChange={onChange}
        className='w-3/12'
        />
        <div className='w-9/12'>{descripcion}</div>
      </label>
    </div>
  )
}

export default CheckBox
